import React from 'react'
import Carditem from './Carditem'
import './Cards.css';
import image9 from '../images/img-9.jpg';
import image8 from '../images/img-8.jpg';
import image7 from '../images/img-7.jpg';
import image6 from '../images/img-6.jpg';
import image5 from '../images/img-5.jpg';
import image4 from '../images/img-4.jpg';
import image3 from '../images/img-3.jpg';
import image2 from '../images/img-2.jpg';

function Cards() {
    return (
        <div className="cards">
            <h1>Check out these epic Destinations!</h1>
            <div className="cards__container">
                <div className="cardss__wrapper">
                    <ul className="cards__items">
                        <Carditem
                            src={image9}
                            text="Explore the hidden waterfall deep inside the Amazon Jungle"
                            label="Adventure"
                            path="/services"
                        />
                    </ul>
                </div>
            </div>
            <div className="cards__container">
                <div className="cardss__wrapper">
                    <ul className="cards__items">
                        <Carditem
                            src={image8}
                            text="Explore the hidden waterfall deep inside the Amazon Jungle"
                            label="Adventure"
                            path="/services"
                        />
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Cards
